import React from 'react';

import './App.scss';
import { Phone } from './components/Phone';

const App = () => (
  <div className="App">
    <h1>React Phone Catalog</h1>
    <Phone />
    <img
      className="phone"
      src="./img/phones/dell-steak-7.0.jpg"
      alt
    />
  </div>
);

export default App;
